ISLAMABAD, Feb 9 (APP): An Independent Candidate Sardar Shahjehan Yousaf has won the Khyber Pakhtunkhwa Assembly election from PK-40, Manshera-V by securing 44,012 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was an Independent Candidate Abdul Shakoor Khan who bagged 43,680 votes.
